import React from "react";
import { ListGroup } from "react-bootstrap";

const ArtistList = (artists) => {
  // const { id, name } = artists;
  console.log(artists);

  const objArtist = Object.fromEntries(artists);
  console.log(objArtist);

  return (
    // <div>Hiiiiiiiii</div>
    <ListGroup>
      {objArtist.map((a) => (
        <ListGroup.Item key={a.id}>{a.name}</ListGroup.Item>
      ))}
    </ListGroup>
  );
};

export default ArtistList;
